# Problem Statement

In the C++ implementation, when setting `max_rows_per_group` and `max_rows_per_file` (see [Python API](https://arrow.apache.org/docs/python/generated/pyarrow.dataset.write_dataset.html) ), these numbers are exact enforced. In the current Rust-base writer, we only close a group uses

```rust
record_batch_buffer.push(batch);
if record_batch_buffer.len() > max_rows_per_group {
  // flush the group
}
```

It only makes the group size "not smaller than max_rows_per_group".

# Desired behavior

The FileWriter should honor these two parameters and write at most the specified rows per group / per file.
